#include <iostream>
#include <vector>
#include <algorithm>

using std::vector;
using std::cout;
using std::cin;
using std::endl;

double mean(vector<int> data)
{
	double calc = 0.0;
	int total = 0;
	for (int i = 0; i < data.size(); i++)
	{
		calc += data[i];
		total++;
	}
	return (calc / total);
}

int firstquartile(vector<int> data)
{
	sort(data.begin(), data.end());
	int location;
	location = data.size() / 4;
	return data[location];
}

int median(vector<int> data)
{
	int location;
	location = data.size() / 2;
	return data[location];
}

int thirdquartile(vector<int> data)
{
	sort(data.begin(), data.end());
	int location;
	location = data.size() * 3 / 4;
	return data[location];
}

int mode(vector<int> data)
{
	vector<int> spec = data;
	sort(spec.begin(), spec.end());
	int max = 1;
	int maxElem = data[0];
	int current = 1;
	for (int i = 1; i < data.size(); i++)
	{
		if (data[i] > data[i - 1])
			current = 1;
		else
			current += 1;
		if (current > max)
		{
			max = current;
			maxElem = data[i];
		}
	}
	return maxElem;

}

int range(vector<int> data)
{
	vector<int> spec = data;
	sort(spec.begin(), spec.end());
	return(spec[spec.size() - 1] - spec[0]);
}

double standardDev(vector<int> data, double mean)
{
	int total = data.size();
	double calc = 0;
	for (int i = 0; i < data.size(); i++)
	{
		calc += ((data[i] - mean) * (data[i] - mean));
	}
	calc /= total;

	double result = sqrt(calc);
	return result;

}

double variance(double sd)
{
	return (sd * sd);
}

double covariance(vector<int> data1, vector<int> data2, double mean1, double mean2)
{
	int total = data1.size();
	double calc = 0;
	for (int i = 0; i < data1.size(); i++)
	{
		calc += ((data1[i] - mean1) * (data2[i] - mean2));
	}
	calc /= total;

	return calc;
}

double correlationCoefficient(double cov, double sd1, double sd2)
{
	return (cov / (sd1 * sd2));
}

double bestLineA(double corcof, double sd1, double sd2)
{
	return ((corcof * sd2) / sd1);
}

double bestLineB(double corcof, double sd1, double sd2, double mean1, double mean2)
{
	return (mean1 + ((corcof * sd2) / sd1) * mean2);
}



